pragma solidity ^0.5.0;
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract YetAnotherCoin is ERC721 {
    string public constant name = "YetAnotherCoin";
    string public constant symbol = "YACoin";

    event CoinGenerated(uint _coinId, uint _propertyId);

    struct YACoins {
        uint propertyId;
        uint valueInEth;
    }

    YACoins[] public yaCoins;

    function getPropertyValue(uint _coinId ) public view returns(uint valueInEth){
        YACoins memory _yac = yaCoins[_coinId];

        valueInEth = _yac.valueInEth;
    }

    function mint(uint _propertyId, uint _value) public payable {
        YACoins memory _yac = YACoins({ propertyId: _propertyId, valueInEth: _value });
        uint _coinId = yaCoins.push(_yac) - 1;

        _mint(msg.sender, _coinId);

        emit CoinGenerated(_coinId, _propertyId);
    }
}
